            // Text to encrypt:
            string clearText = "aaaaaaaaaaaaaaaaaaaaaaaaaaaaa";

            // Encrypt text:
            string cipherText = AES_Encrypt(clearText);
            //string cipherText = "89285bfcd1c226242c5a983c6a02ee47e5c2d19c8bacc13843737fc6127678fd";

