        static private void HmacMethods()
        {
            // Create new 'hex HMAC key':
            string createHmacKeyAsHexString = CreateHmacKey();

            // Create new 'hash content' with the previously created 'hex HMAC key':
            string hashContent = HashingContent(createHmacKeyAsHexString);

            Console.WriteLine(hashContent);
        }

        /// <summary>
        /// Hashing a content.
        /// </summary>
        static private string HashingContent(
            string createHmacKeyAsHexString)
        {
            using HMACSHA512 sha512 = new HMACSHA512(Encoding.UTF8.GetBytes(createHmacKeyAsHexString));

            return ByteArrayToString(sha512.ComputeHash(Encoding.UTF8.GetBytes("Guilherme"))).ToLower();
        }

        /// <summary>
        /// Validate hash content based on a key
        /// </summary>
        static private bool ValidateHashContent(
            IEnumerable<byte> receivedHash,
            byte[] computedHashBytes,
            byte[] hmacKey)
        {
            using HMACSHA512 sha512 = new HMACSHA512(hmacKey);
            byte[] computedHash = sha512.ComputeHash(computedHashBytes);

            if (computedHash.SequenceEqual(receivedHash))
            {
                return true;
            }
            else
            {
                return false;
            }
        }

        /// <summary>
        /// Create a new HMAC Key.
        /// </summary>
        static private string CreateHmacKey()
        {
            string newHmacKey = string.Empty;
            using (HMACSHA512 sha512 = new HMACSHA512())
            {
                newHmacKey = ByteArrayToString(sha512.Key);
            }
            return newHmacKey;
        }

        /// <summary>
        /// Convert byte array to hex string without separator "-".
        /// </summary>
        static string ByteArrayToString(byte[] ba) =>
            BitConverter.ToString(ba).Replace("-", "");
